        }
    }
   onChang =(e)=>{
       this.setState({
           data:e.target.value,
       });
   };
    render(){
       return (
           <div>
               <input type="text" onChange={this.onChang}/>
       <h3>{this.state.data}</h3>
           <h1> {this.props.nam}</h1>
